script: |
  super -f text -I q9253.spq | sort > q9253.out

inputs:
  - name: q9253.spq
    data: |
      SELECT DISTINCT + col1 * + 15 - col2 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT ( col2 * - + CAST ( NULL AS INTEGER ) - + col1 + + col2 + + col2 ) IS NULL;
  - name: tab2

outputs:
  - name: q9253.out
    data: |
